const URL = "https://api.nytimes.com/svc/books/v3/lists/names?api-key=SSD9FfRP9CMHdbUt2fTmYDrnMQx7Mjqf"

export async function getListName (){
  try {
    const responce = await fetch (URL, {method: GET})
    const json = await response.json();
    return json;
  }catch(error){
      console.log(error);
  }
}
